import React from 'react';
import Columns from 'react-columns';
import GridColumn from './GridColumn';


export default function ScheduleGrid(){
  return (
  <Columns columns="4">
    <div style = {{paddingBottom: 20}}>
    <p>Monday</p>
     <GridColumn/>
     </div>
     <div style = {{paddingBottom: 20}}>
     <p>Tuesday</p>

     <GridColumn/>
     </div>
     <div style = {{paddingBottom: 20}}>
     <p>Wednesday</p>

     <GridColumn/>
     </div>
     <div style = {{paddingBottom: 20}}>
     <p>Thursday</p>

     <GridColumn/>
     </div>
  </Columns>
);
}
